import React, { Component, useContext } from "react";
import "./App.css";
import AppContextProvider from "./contexts/global";

const App = ({ props }) => {
  console.log(this.props);
  return (
    <React.Fragment>
      <AppContextProvider value={props}>
        <h1>hello</h1>
      </AppContextProvider>
    </React.Fragment>
  );
};

export default App;
